import Head from "next/head";


function Blog() {
  return (
    <>
      <Head>
        <title>My Blog!</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div>Welcome, blog reader!</div>
    </>
  );
}

export default Blog;
